import React from "react";
import Navbar from "../../components/molecules/NavBar";
import ArtWorkDetails from "../../components/organisms/ArtWorkDetials";
import { Box } from "@mui/material";
import TextBackButton from "../../components/molecules/TextBackButton";
import { useNavigate } from "react-router-dom";
import ArtWorkText from "../../components/atom/AllArtWorkText";

const DetailsPage = () => {
  const navigate = useNavigate();
  return (
    <Box>
      <TextBackButton handleBackToList={() => {navigate("/");}}/>
      <ArtWorkDetails />
    </Box>
  );
};

export default DetailsPage;
